import React from 'react';
import { PortHead } from './components/header';
import { NavLink } from 'react-router-dom';
import { DoubleCard, Card, Wrapper } from './components/components';
export const Portfolio = () => (
	<main>
		<PortHead />
		<Wrapper>
			<DoubleCard back="./img/nasa.jpg" title="astronauts" subtitle="" to="/" color="white" />
			<Card back="./img/slr.jpeg" title="astronauts" subtitle="" to="/" color="white" />
			<Card back="./img/portf.jpeg" title="astronauts" subtitle="" to="/" color="white" />
			<Card back="./img/nasa.jpg" title="astronauts" subtitle="" to="/" color="white" />
			<Card back="./img/slr.jpeg" title="astronauts" subtitle="" to="/" color="white" />
			<Card back="./img/portf.jpeg" title="astronauts" subtitle="" to="/" color="white" />
			<DoubleCard
				back="./img/fdslr.jpeg"
				title="astronauts"
				to="/"
				color="white"
			/>
		</Wrapper>
	</main>
);


